import React, { useState } from "react";
import { MDBIcon } from "mdb-react-ui-kit";

import SideNav, { NavItem, NavIcon, NavText } from "@trendmicro/react-sidenav";

import "@trendmicro/react-sidenav/dist/react-sidenav.css";

import TopNavigation from "../components/UI/TopNavigation";

import { useNavigate } from "react-router-dom";

function Test() {
  const [expandedNav, setExpandedNav] = useState(false);

  let navigate = useNavigate();

  return (
    <div>
      <SideNav
        onToggle={() => setExpandedNav(!expandedNav)}
        style={{
          padding: "0px 0px 0px 0px",
          position: "fixed",
        }}
      >
        <SideNav.Toggle />

        <SideNav.Nav defaultSelected="dashboard">
          <NavItem
            eventKey="dashboard"
            onSelect={() => navigate("/dashboard", { replace: true })}
          >
            <NavIcon>
              <MDBIcon
                fas
                icon="tachometer-alt"
                style={{ fontSize: "1.75em" }}
              />
            </NavIcon>
            <NavText>Dashboard</NavText>
          </NavItem>
          <NavItem
            eventKey="transactions"
            onSelect={() => navigate("/transactions", { replace: true })}
          >
            <NavIcon>
              <MDBIcon fas icon="box" style={{ fontSize: "1.75em" }} />
            </NavIcon>
            <NavText>Aufträge</NavText>
          </NavItem>
          <NavItem
            eventKey="partners"
            onSelect={() => navigate("/partners", { replace: true })}
          >
            <NavIcon>
              <MDBIcon fas icon="address-book" style={{ fontSize: "1.75em" }} />
            </NavIcon>
            <NavText>Partner</NavText>
          </NavItem>
          <NavItem
            eventKey="settings"
            onSelect={() => navigate("/transactions", { replace: true })}
          >
            <NavIcon>
              <MDBIcon fas icon="cog" style={{ fontSize: "1.75em" }} />
            </NavIcon>
            <NavText>Einstellungen</NavText>
          </NavItem>
        </SideNav.Nav>
      </SideNav>

      <div
        class="TopNav"
        style={{
          marginLeft: expandedNav ? 240 : 64,
          padding: "0px 0px 0px 0px",
          transition: "0.2s",
        }}
      >
        <TopNavigation />
      </div>
      <div
        class="Content"
        style={{
          marginLeft: expandedNav ? 240 : 64,
          padding: "0px 20px 0px 20px",
          transition: "0.2s",
        }}
      >
        <h1>Testgelände</h1>
      </div>
    </div>
  );
}

export default Test;
